import React from 'react';

function AdminDashboard() {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Admin Dashboard</h1>
      <div style={{ marginTop: '1rem' }}>
        <button onClick={() => alert('View Pending Requests')}>Pending Requests</button><br /><br />
        <button onClick={() => alert('View Approved Requests')}>Approved Requests</button><br /><br />
        <button onClick={() => alert('View Rejected Requests')}>Rejected Requests</button><br /><br />
      </div>
    </div>
  );
}

export default AdminDashboard;
